script: |
  super -f text -I q11437.spq | sort > q11437.out

inputs:
  - name: q11437.spq
    data: |
      SELECT col0 * + col1 AS col0 FROM tab2 (FORMAT parquet) AS cor0 WHERE NOT - cor0.col0 * + col1 + - col1 IN ( + cor0.col1 * cor0.col2 );
  - name: tab2

outputs:
  - name: q11437.out
    data: |
      1343
      217
      4602
